プリセットメモリー、各モード100局登録可能です。放送局を自動選局できるオートスキャン機能が便利♪暗がりでも操作しやすいバックライト付液晶もポイント♪便利な時刻表示・アラーム＆スリープ機能もついています。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">プリセットメモリー、各モード100局登録可能です。放送局を自動選局できるオートスキャン機能が便利♪暗がりでも操作しやすいバックライト付液晶もポイント♪便利な時刻表示・アラーム＆スリープ機能もついています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">約幅128×高さ78×厚さ32mm(最大値)</font><br><font color="#333333" size="-1">個装サイズ：10×19×4cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約178g(ストラップ含み、電池除く)</font><br><font color="#333333" size="-1">個装重量：220g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">同調方式:PLLデジタル同調<br>受信周波数:FM:76～95MHz、MW(AM):522～1620kHz<br>スピーカー:直径45mm(丸型・25Ω)<br>電源:DC3V 単三形アルカリ乾電池×2本(別売)、DC4.5V 300mA(別売ACアダプター使用)<br>出力端子:φ3.5mmステレオミニジャック<br>電池持続時間(JEITA)/スピーカー使用時:MW(AM)約45時間、FM:約40時間<br>※単三形アルカリ乾電池を使用した場合</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">ストラップ<br>取扱説明書<br>保証書(保証期間:1年間)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</fon