大型デジタルディスプレイ時計が付いたアラーム機能搭載のCD＆ラジオプレーヤー。普段はCDやラジオプレーヤーとしても十分に使えます。目覚まし音は3種類(CD、ラジオ、ブザー)の設定が可能です。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">大型デジタルディスプレイ時計が付いたアラーム機能搭載のCD＆ラジオプレーヤー。普段はCDやラジオプレーヤーとしても十分に使えます。目覚まし音は3種類(CD、ラジオ、ブザー)の設定が可能です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">幅175×高さ95×奥行190mm</font><br><font color="#333333" size="-1">個装サイズ：26×20×13cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約1.2kg(バックアップ用乾電池含まず)</font><br><font color="#333333" size="-1">個装重量：1500g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS樹脂</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">電源:AC100W(50/60Hz)<br>消費電力:11W<br>実用最大出力:0.8W+0.8W・総合1.6W<br>CD部/<br>　再生可能ディスク:音楽CD、CD-R、CD-RW<br>ラジオ部/<br>　受信周波数:FM76～90Whz/AM522～1620KHz<br>　AM/FMラジオ<br>時計部/<br>　電源(バックアップ用):単4型乾電池×2本(別売)<br>　時計表示方式:12時間<br>　アラーム音選択:CD/AM/FM/ブザー<br>　スヌーズ機能/スリープ機能<br>　全曲リピート再生/曲順プログラム再生</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書<br>保証書(保証期間:1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>T